-- Table structure for randl_module
-- ----------------------------
DROP TABLE IF EXISTS `randl_module`;
CREATE TABLE `randl_module`  (
  `fid` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '菜单中文名',
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '菜单描述',
  `path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '菜单路径',
  `level` int(255) DEFAULT 1 COMMENT '层级',
  `module_order` int(255) DEFAULT 1 COMMENT '排序',
  `icon` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT '/' COMMENT '菜单图标 默认为斜杠',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '上级菜单Id',
  `is_able` tinyint(255) DEFAULT 1 COMMENT '是否可用',
  `app_id` bigint(11) NOT NULL,
  `create_time` datetime(0) DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0),
  PRIMARY KEY (`fid`) USING BTREE,
  INDEX `parent_id_1`(`parent_id`) USING BTREE,
  INDEX `app_id_fk`(`app_id`) USING BTREE,
  CONSTRAINT `app_id_fk` FOREIGN KEY (`app_id`) REFERENCES `randl_app` (`fid`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `id_to_parent_id` FOREIGN KEY (`parent_id`) REFERENCES `randl_module` (`fid`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 33 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin ROW_FORMAT = Dynamic;

