-- Table structure for randl_user
-- ----------------------------
DROP TABLE IF EXISTS `randl_user`;
CREATE TABLE `randl_user`  (
  `uid` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '用户id主键',
  `account` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '系统账号',
  `phone_number` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '手机号码',
  `email_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '邮箱地址',
  `password` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码',
  `registration_time` datetime(0) DEFAULT NULL COMMENT '注册时间',
  `registration_ip` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '注册ip',
