  `surface_image_id` bigint(20) DEFAULT NULL COMMENT '头像id',
  `channel` int(255) DEFAULT NULL COMMENT '用户来源渠道 0:管理员添加 | 1:用户注册 | 2:数据库直接添加',
  PRIMARY KEY (`uid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 23 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'RandL系统的用户表' ROW_FORMAT = Dynamic;

