-- ----------------------------
-- View structure for select_user_personal_info_view
-- ----------------------------
DROP VIEW IF EXISTS `select_user_personal_info_view`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `select_user_personal_info_view` AS select `tb_1`.`fid` AS `fid`,`tb_2`.`uid` AS `uid`,`tb_1`.`gender` AS `gender`,`tb_1`.`age` AS `age`,`tb_1`.`birthday` AS `birthday`,`tb_1`.`nickname` AS `nickname`,`tb_1`.`realname` AS `realname`,`tb_1`.`home_address` AS `home_address`,`tb_1`.`school` AS `school`,`tb_1`.`company` AS `company`,`tb_1`.`job` AS `job`,`tb_1`.`contact_ways` AS `contact_ways`,`tb_1`.`personalized_signature` AS `personalized_signature`,`tb_1`.`identity_number` AS `identity_number`,`tb_2`.`account` AS `account`,`tb_2`.`phone_number` AS `phone_number`,`tb_2`.`email_address` AS `email_address`,`tb_2`.`surface_image_id` AS `surface_image_id`,`tb_2`.`channel` AS `channel`,`tb_2`.`account_status` AS `account_status` from (`randl_user` `tb_2` left join `randl_personal_info` `tb_1` on((`tb_1`.`uid` = `tb_2`.`uid`)));

SET FOREIGN_KEY_CHECKS = 1;
